class App extends Component {
  async componentDidMount() {
    const res = await axios.get('https://api.github.com/users');
  }

  render() {
    return (
      <div className='App'>
        <Navbar />
        <div className='container'>
          <Users />
        </div>
      </div>
    );
  }
}

export default App;
